FormulaDrivenCsvFile.CsvFileFormula:
LET $contextForm := "Vendor";
LET $vendorRecordIDs := DB_LOOKUPALL("Vendor RecordID", "Contract", "[LineNumber] = 1 AND [Vendor RecordID] IS NOT NULL");
LET $filter := "[LineNumber] = 1 AND [RecordID] IN " & DB_ENCODECONSTANT($vendorRecordIDs);

LET $aliasColumns :=
ARRAY(
	ARRAY("Vendor RecordID",  		"RecordID"),
	ARRAY("Vendor Name", 			"Company Name"),
	ARRAY("Trading Name", 			"Trading Name"),
	ARRAY("Business Number Type", 	"Business Number Type"),
	ARRAY("Business Number", 		"BusinessNumber"),
	ARRAY("Vendor Suburb",			"Suburb"),
	ARRAY("Vendor State",			"State"),
	ARRAY("Vendor Country", 		"Country"),
	ARRAY("Vendor Postcode", 		"Postcode")
);

LET $alias := ARRAY_CONCAT(ARRAY_SELECT($aliasColumns, $(i, item) ARRAY_FIRST($item)), "VP Channel Code");
LET $columns := ARRAY_SELECT($aliasColumns, $(i, item) ARRAY_LAST($item));
LET $lookupColumns := ARRAY_SELECT($columns, $(i, item) "[" & $item & "]");

LET $data := 
DB_REPORT(
		$lookupColumns,
		$contextForm,
		$filter
	);

LET $data := ARRAY_SELECT(
	$data, 
	$(i, row) (
		LET $rowCleaned := ARRAY_SELECT(
			$row,
			$(j, item) IF(ISTEXT($item), REPLACESUBSTRING(CHAR(10), REPLACESUBSTRING(CHAR(13), $item, ""), ""), $item)
		);

		RETURN ARRAY_CONCAT($rowCleaned, [Channel Code])
	)
);

RETURN ARRAY_CONCAT(
	ARRAY($alias), 
	$data
)

